import React, {Component } from 'react';
import {Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, Button, CardMenu, IconButton}  from 'react-mdl';

class Projects extends Component{
    constructor(props){
        super(props);
        this.state = {activeTab: 0};
    }
    toggleCategories(){

        if (this.state.activeTab === 0){
            return(
                // Angular project 1
                <Card shadow={5} style={{minWidth:'450', margin:'auto'}}>
                    <CardTitle style={{color:'black', height:'176px', background:
                    'url(https://anthoncode.com/wp-content/uploads/2019/01/angular-logo-png.png) center / cover'}}> Angular Project #1</CardTitle>
                    <CardText>
                        This is my angular projects i love it
                    </CardText>
                    <CardActions border>
                        <Button colored>Github</Button>
                        <Button colored>CodePen</Button>
                        <Button colored>LiveDemo</Button>
                    </CardActions>
                    <CardMenu style={{color:'#fff'}}>
                        <IconButton name="share"/>
                    </CardMenu>
                </Card>,
                // Angular project 2
                <Card shadow={5} style={{minWidth:'450', margin:'auto'}}>
                <CardTitle style={{color:'black', height:'176px', background:
                'url(https://anthoncode.com/wp-content/uploads/2019/01/angular-logo-png.png) center / cover'}}> Angular Project #2</CardTitle>
                <CardText>
                    This is my angular projects i love it
                </CardText>
                <CardActions border>
                    <Button colored>Github</Button>
                    <Button colored>CodePen</Button>
                    <Button colored>LiveDemo</Button>
                </CardActions>
                <CardMenu style={{color:'#fff'}}>
                    <IconButton name="share"/>
                </CardMenu>
            </Card>,
                            // Angular project 3
                            <Card shadow={5} style={{minWidth:'450', margin:'auto'}}>
                            <CardTitle style={{color:'black', height:'176px', background:
                            'url(https://anthoncode.com/wp-content/uploads/2019/01/angular-logo-png.png) center / cover'}}> Angular Project #2</CardTitle>
                            <CardText>
                                This is my angular projects i love it
                            </CardText>
                            <CardActions border>
                                <Button colored>Github</Button>
                                <Button colored>CodePen</Button>
                                <Button colored>LiveDemo</Button>
                            </CardActions>
                            <CardMenu style={{color:'#fff'}}>
                                <IconButton name="share"/>
                            </CardMenu>
                        </Card>
            )
        } else if (this.state.activeTab === 1){
            return(
                <div>
                    <h1>This is Firebase</h1>
                </div>
            )
        }else if (this.state.activeTab === 2){
                return(
                    <div>
                        <h1>This is React</h1>
                    </div>
                )
         }
    }


    render(){
        return(
            <div className="category-tabs">
                <Tabs activeTab={this.state.activeTab} onChange={(tabId) => this.setState ({activeTab: tabId})} ripple>
                    <Tab>Angular</Tab>
                    <Tab>Firebase</Tab>
                    <Tab>React</Tab>
                </Tabs>

                <section className="projects-grid">
                    <Grid className="projects-grid">
                        <Cell col={12}>
                            <div className="content">
                            {this.toggleCategories()}
                            </div>
                        </Cell>

                    </Grid>
                </section>
            </div>
        )
    }
}

export default Projects;
